DELIMITER $$
--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_listar_candidatos_ingresos` (IN `p_search` VARCHAR(100), IN `p_estado` CHAR(1), IN `p_limit` INT, IN `p_offset` INT)   BEGIN
	 -- SQL_CALC_FOUND_ROWS hace que MySQL calcule internamente
    -- cuántas filas existirían SIN el LIMIT/OFFSET.
    -- El valor se obtiene después con FOUND_ROWS()
    SELECT SQL_CALC_FOUND_ROWS
        c.id,
        c.identidad,
        c.nombre,
        c.apellido,
        c.telefono,
        c.correo,
        c.direccion,
        c.generoM_F,
        c.activo,
        c.fecha_nacimiento,
        c.comentarios,

        -- Indicador de ingreso activo
        CASE 
            WHEN ei.id IS NOT NULL THEN 's'
            ELSE 'n'
        END AS activo_ingreso,

        ei.ComenProhibir,
        ei.prohibirIngreso,
        ei.bloqueo_recomendado

    FROM candidatos c

    LEFT JOIN egresos_ingresos ei 
        ON ei.identidad = c.identidad
        AND ei.activo = 's'
	
      WHERE
        (
            p_search IS NULL
            OR c.identidad LIKE CONCAT('%', p_search, '%')
            OR c.nombre LIKE CONCAT('%', p_search, '%')
            OR c.apellido LIKE CONCAT('%', p_search, '%')
            OR c.activo LIKE CONCAT('%', p_search, '%')
        )
        AND (
            p_estado IS NULL
            OR c.activo = p_estado
        )
    ORDER BY c.id DESC
    LIMIT p_limit OFFSET p_offset;
     -- Total de registros sin LIMIT
    SELECT FOUND_ROWS() AS total;
END$$

