DELIMITER $$
CREATE TRIGGER `trg_validar_puesto_empresa_ins` BEFORE INSERT ON `egresos_ingresos` FOR EACH ROW BEGIN
    IF NOT EXISTS (
        SELECT 1
        FROM puestos p
        INNER JOIN departamentos d ON d.id = p.departamento_id
        WHERE p.id = NEW.id_puesto
          AND d.empresa_id = NEW.id_empresa
    ) THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'El puesto no pertenece a la empresa seleccionada';
    END IF;
END
$$
DELIMITER ;

